import React from "react"
import BottomNav from "../BottomNav/BottomNav"

export default class Footer extends React.Component {
  render() {
    return (
      <footer>
        <div>
          <h1>Este es nuestro footer</h1>
        </div>
        <BottomNav />
      </footer>
    )
  }
}
